INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 2.1, 3001100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 2, "ヤマト", 130011, 100);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 4, 5.68, 3001101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 2, "ヤマト", 130011, 101);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3001, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 0.0, 3001102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 1, "ヤマト", 130011, 102);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 0.0, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 1, "フブキ", 130211, 100);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 0.0, 3002101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 1, "フブキ", 130211, 101);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 5, 8.53, 3002102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 2, "フブキ", 130211, 102);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 5.67, 3002103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 1, "フブキ", 130211, 103);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3002, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 0.0, 3002104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 1, "フブキ", 130211, 104);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3004, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 3, 0.0, 3002300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3, "フブキ", 130211, 300);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3005, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 0.0, 3002400, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 7, "フブキ", 130211, 301);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3003, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 2, 4.4, 3003200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 1, "フブキ", 130211, 200);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3003, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 7, 0.0, 3003201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 7, "フブキ", 130211, 201);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3003, "2030/01/01 14:59:59", -416.5, 0.0, "2024/10/31 12:00:00", 1, 5.6, 3003202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 2, "フブキ", 130211, 202);
